INSERT INTO `T_TEST_REVS` VALUES (289,176,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' Verify the retrieving of LOPOOL information when MVC4 are\n UNUSED, USEDBYHOCC and USEDBYLOVCGMEM and CONSTATE parameter \n in RTRV-LOPOOL command is set to ALL, UNUSED, USEDBYHOCC\n','4','10101','2017-03-21 09:42:29'),(290,177,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' Verify the condition types and factory default attributes\n for LOVCn according to the asap profile selected and table.5.1\n of TPS doc. MXH60GLO \n The check is performed on 6 TU3s (2 for each 128 bank) and \n other 6 TU12s (2 for each 128 bank). \n','1','11111','2017-03-21 09:42:29'),(291,178,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' Verify the DBCHG messages generation for each MVC4 and MVC4TUn facilities\n','2','11111','2017-03-21 09:42:29'),(292,179,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' This test verifies the reporting/clearing of MAN condition for MVC4,\n MVC4TU3 and MVC4TU12 facilities. For each block of 3x128 MVC4 one \n facility of each type is chosen. On it the presence/absence of alarm is verified. \n','3','10101','2017-03-21 09:42:29'),(293,180,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' Verify that MVC4 and MVC4TUn are created/deleted when board is created/deleted\n','3','11111','2017-03-21 09:42:29'),(294,181,'7.20.00@01',0,0,'',' NA','tosima','2017-03-21 10:42:29','SVT',' Check that when enabling and disabling POM and EGPOM on MVC4TU12\n no alarms/errors are generating on SDH. All 384x3x21=24192 TU12s \n are verified. \n S1 and S2 port on NE must be STM64\n','1','11111','2017-03-21 09:42:29'),(295,182,'7.20.00@01',0,0,'',' NA','tosima','2017-03-21 10:42:29','SVT',' Check that when enabling and disabling POM and EGPOM on MVC4TU3\n no alarms/errors are generating on SDH. The check i performed\n for all the 384x3=1152 TU3s\n','1','11111','2017-03-21 09:42:29'),(296,183,'7.20.00@01',0,0,'',' ','tosima','2017-03-21 10:42:29','SVT',' Check that when enabling and disabling POM and EGPOM on MVC4TU12\n no alarms/errors are generating on SDH. For each block of 128 VC4 \n is taken 1 VC4 and for this all VC12s are checked. \n S1 and S2 port on NE must be STM64\n','1','11111','2017-03-21 09:42:29'),(297,184,'7.20.00@01',0,0,'',' ','tosima','2017-03-21 10:42:29','SVT',' Check that when enabling and disabling POM and EGPOM on MVC4TU3\n no alarms/errors are generating on SDH  \n S1 and S2 port on NE must be STM64\n','1','11111','2017-03-21 09:42:29'),(298,185,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' This test verifies the detection/clearance of RDI alarm on MVC4TU12 facilities\n','1','11111','2017-03-21 09:42:29'),(299,186,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' This test verifies the detection/clearance of RDI alarm on MVC4TU3 facilities\n','1','11111','2017-03-21 09:42:29'),(300,187,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' Verify the detection of SD alarm on MVC4TU12 facility when BER (continuous/burst) and\n EBER (continuous) are inserted.\n','1','11111','2017-03-21 09:42:29'),(301,188,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' Verify the detection of SD alarm on MVC4TU3 facility when BER (continuous/burst) and\n EBER (continuous) are inserted.\n','1','11111','2017-03-21 09:42:29'),(302,189,'7.20.00@01',0,0,'',' Needs at least 5 half slot free to equip 10GSO extra board','tosima','2017-03-21 10:42:29','SVT',' To verify that, for each MVC4-TUn path facility, SDEE is set when used in cross-connection.\n','2','11111','2017-03-21 09:42:29'),(303,190,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' Verify the detection of SSF-V, AIS-V, LOP-V alarm on MVC4TU12 facilities and\n TU-AIS, TU-LOP on instrument side.\n','1','11111','2017-03-21 09:42:29'),(304,191,'7.20.00@01',0,0,'','','tosima','2017-03-21 10:42:29','SVT',' Verify the detection of SSF-V, AIS-V, LOP-V alarm on MVC4TU3 facilities 